// src/components/Projects.js
import React from 'react';

const projects = [
  {
    title: 'Project One',
    description: 'Description for project one',
    link: '#',
    image: 'path/to/image1.png'
  },
  {
    title: 'Project Two',
    description: 'Description for project two',
    link: '#',
    image: 'path/to/image2.png'
  },
  // Add more projects as needed
];

const Projects = () => {
  return (
    <section id="projects" className="h-screen bg-black text-white flex flex-col items-center justify-center text-center">
      <h2 className="text-3xl md:text-5xl font-bold mb-4">My Projects</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 p-4">
        {projects.map((project, index) => (
          <div key={index} className="bg-gray-800 rounded-lg p-4">
            <img src={project.image} alt={project.title} className="w-full h-48 object-cover rounded-t-lg"/>
            <h3 className="text-2xl font-bold mt-4">{project.title}</h3>
            <p className="text-gray-400 mt-2">{project.description}</p>
            <a href={project.link} className="text-red-500 hover:underline mt-4 inline-block">Learn more</a>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
